<script>
    document.addEventListener("DOMContentLoaded", function () {
        flatpickr('#dateRangePicker', {
            mode: 'range',
            dateFormat: 'Y-m-d',
            onChange: function (selectedDates) {
                if (selectedDates.length === 2) {
                    const start = moment(selectedDates[0]).format('YYYY-MM-DD');
                    const end = moment(selectedDates[1]).format('YYYY-MM-DD');    
                    loadDashboardCounters(start,end);
                    loadDashboardCharts(start,end);
                }
            }
        });

        function loadDashboardCounters(start, end) {
            $.ajax({
                url: "{{ route('home') }}",
                data: { start_date: start, end_date: end },
                success: function (res) {  
                    $('#totalPaidUsers').text(res.data.dashboard.total_paid_users);
                    $('#newPaidUsers').text(res.data.dashboard.new_paid_users);
                    $('#repurchaseRatio').text(res.data.dashboard.repurchase_ratio);
                    $('#totalArticles').text(res.data.dashboard.total_articles);
                    $('#userConversionRatio').text(res.data.dashboard.user_convertion_ratio);
                    $('#totalAppUsers').text(res.data.dashboard.total_app_users);
                    $('#totalAnonymousUsers').text(res.data.dashboard.total_anonymous_users);
                    $('#totalHealthExperts').text(res.data.dashboard.total_health_experts);

                    // Update App Users Table
                    let appUsersTable = $('#appUsersTable tbody');
                    appUsersTable.empty();
                    if (res.data.app_users.length > 0) {
                        res.data.app_users.forEach(user => {
                            appUsersTable.append(`
                                <tr>
                                    <td>${user.id}</td>
                                    <td><a href="/users/${user.id}">${user.display_name.substring(0, 10)}</a></td>
                                    <td>${user.email.substring(0, 20)}</td>
                                    <td>${user.created_at}</td>
                                </tr>
                            `);
                        });
                    } else {
                        appUsersTable.append(`<tr><td colspan="4" class="text-center">{{ __('message.not_found_entry', ['name' => __('message.users')]) }}</td></tr>`);
                    }

                    // Update Anonymous Users Table
                    let anonymousUsersTable = $('#anonymousUsersTable tbody');
                    anonymousUsersTable.empty();
                    if (res.data.annonymous_users.length > 0) {
                        res.data.annonymous_users.forEach(user => {
                            anonymousUsersTable.append(`
                                <tr>
                                    <td>${user.id}</td>
                                    <td><a href="/anonymoususer/${user.id}">${user.display_name.substring(0, 10)}</a></td>
                                    <td>${user.email.substring(0, 20)}</td>
                                    <td>${user.created_at}</td>
                                </tr>
                            `);
                        });
                    } else {
                        anonymousUsersTable.append(`<tr><td colspan="4" class="text-center">{{ __('message.not_found_entry', ['name' => __('message.anonymous_users')]) }}</td></tr>`);
                    }

                    // Update Subscriptions Table
                    let subscriptionsTable = $('#subscriptionsTable tbody');
                    subscriptionsTable.empty();
                    if (res.data.subscription.length > 0) {
                        res.data.subscription.forEach(sub => {
                            subscriptionsTable.append(`
                                <tr>
                                    <td>${sub.id}</td>
                                    <td><a href="/users/${sub.user.id}">${sub.user.display_name.substring(0, 10)}</a></td>
                                    <td>${sub.plan}</td>
                                    <td>${sub.price}</td>
                                    <td>${sub.status == 1 ? 'active' : 'inactive'}</td>
                                    <td>${sub.created_at}</td>
                                </tr>
                            `);
                        });
                    } else {
                        subscriptionsTable.append(`<tr><td colspan="6" class="text-center">{{ __('message.not_found_entry', ['name' => __('message.subscription')]) }}</td></tr>`);
                    }

                }
            });
        }

        function loadDashboardCharts(start, end) {
            $.ajax({
                url: "{{ route('charts') }}",
                data: { start_date: start, end_date: end },
                success: function (res) {
                    window.renderCharts(res);
                }
            });
        }
    });
</script>
